// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

import {IPoolAddressesProvider, IPool, IFlashLoanSimpleReceiver} from "./interfaces/AaveV3.sol";
import "./interfaces/IUniswapV2Router02.sol";

contract MultiPairFlashArbitrage is Ownable, IFlashLoanSimpleReceiver {
    IPoolAddressesProvider public immutable ADDRESSES_PROVIDER;
    IPool public immutable POOL;

    address[] public routers;
    uint256 public minProfit;

    event ExecutedTrade(uint256 profit, address token, address router1, address router2);

    constructor(
        address addressProvider_,
        address[] memory _routers,
        uint256 _minProfit
    ) {
        ADDRESSES_PROVIDER = IPoolAddressesProvider(addressProvider_);
        POOL = IPool(IPoolAddressesProvider(addressProvider_).getPool());
        routers = _routers;
        minProfit = _minProfit;
    }

    function executeOperation(
        address asset,
        uint256 amount,
        uint256 premium,
        address initiator,
        bytes calldata params
    ) external override returns (bool) {
        require(msg.sender == address(POOL), "Caller must be POOL");
        require(initiator == address(this), "Only contract can initiate");

        (
            address[] memory path1,
            address[] memory path2,
            address router1,
            address router2
        ) = abi.decode(params, (address[], address[], address, address));

        IERC20(asset).approve(router1, amount);

        uint256 midAmount = _swap(router1, amount, path1);
        IERC20(path1[path1.length - 1]).approve(router2, midAmount);

        uint256 finalAmount = _swap(router2, midAmount, path2);
        uint256 totalOwed = amount + premium;

        require(finalAmount > totalOwed + minProfit, "Not profitable");

        IERC20(asset).approve(address(POOL), totalOwed);

        emit ExecutedTrade(finalAmount - totalOwed, asset, router1, router2);

        return true;
    }

    function _swap(
        address router,
        uint256 amountIn,
        address[] memory path
    ) internal returns (uint256) {
        uint256[] memory amounts = IUniswapV2Router02(router).swapExactTokensForTokens(
            amountIn,
            1,
            path,
            address(this),
            block.timestamp
        );
        return amounts[amounts.length - 1];
    }

    function getRouters() external view returns (address[] memory) {
        return routers;
    }

    function setRouters(address[] calldata _routers) external onlyOwner {
        routers = _routers;
    }

    function setMinProfit(uint256 _minProfit) external onlyOwner {
        minProfit = _minProfit;
    }

    function withdrawTokens(address token) external onlyOwner {
        uint256 balance = IERC20(token).balanceOf(address(this));
        IERC20(token).transfer(msg.sender, balance);
    }
}

